import React from 'react';
import BackgroundVideo from 'https://www.youtube.com/watch?v=e5xFa3HeAMo';
import Seta from '../../Assets/seta.png'
import './main.scss'

export default()=>{

    return(
        <div className="container">
            <iframe src={BackgroundVideo} allowFullScreen="true"></iframe>

            <div className="seta">
                <img src={Seta} alt="Seta para baixo"/>
            </div>

        </div>
    )
}
